class Attributes {
  Attributes({
    String? title,
    String? slug,
    String? type,
    List<Items>? items,
    String? url,
  }) {
    _title = title;
    _slug = slug;
    _type = type;
    _items = items;
    _url = url;
  }

  Attributes.fromJson(dynamic json) {
    _title = json['title'];
    _slug = json['slug'];
    _type = json['type'];
    if (json['items'] != null) {
      _items = [];
      json['items'].forEach((v) {
        _items?.add(Items.fromJson(v));
      });
    }
    _url = json['url'];
  }

  String? _title;
  String? _slug;
  String? _type;
  List<Items>? _items;
  String? _url;

  Attributes copyWith({
    String? title,
    String? slug,
    String? type,
    List<Items>? items,
    String? url,
  }) =>
      Attributes(
        title: title ?? _title,
        slug: slug ?? _slug,
        type: type ?? _type,
        items: items ?? _items,
        url: url ?? _url,
      );

  String? get title => _title;

  String? get slug => _slug;

  String? get type => _type;

  List<Items>? get items => _items;

  String? get url => _url;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['title'] = _title;
    map['slug'] = _slug;
    map['type'] = _type;
    if (_items != null) {
      map['items'] = _items?.map((v) => v.toJson()).toList();
    }
    map['url'] = _url;
    return map;
  }
}

